/* eslint-disable jsx-a11y/alt-text */
import React from "react";

const NearByPlaces = () => {
  return (
    <>
      <div>
        <div className="row">
          <h3>Around Me</h3>
        </div>
        <div className="row">
          <div className="col-6">My Itinerary</div>
          <div className="col-6 text-end textColor">See More</div>
        </div>
        <br />
        <div className="row">
          <div className="col-2 ">
            <img
              src={Image}
              height={114}
              width={114}
              className="borderRadius"
            />
            <label>Minions</label>
          </div>
          <div className="col-2 ">
            <img
              src={Image}
              height={114}
              width={114}
              className="borderRadius"
            />
            <label>Minions</label>
          </div>
          <div className="col-2 ">
            <img
              src={Image}
              height={114}
              width={114}
              className="borderRadius"
            />
            <label>Minions</label>
          </div>
        </div>
      </div>
    </>
  );
};

export default NearByPlaces;
